const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">


    <p>{`RedisInsight has built-in support for Redis Modules like RedisJSON, RediSearch, RedisGraph, Streams, RedisTimeSeries, and RedisGears. RedisGears enables reactive programming at the database level. It's like using lambda functions, but with a dramatically lower latency, and with much less encoding/decoding overhead. `}</p>
    <p>{`Support for `}<a parentName="p" {...{
        "href": "https://oss.redislabs.com/redisgears/"
      }}>{`RedisGears`}</a>{` was first introduced in RedisInsight v1.5.0. RedisInsights allows you:`}</p>
    <ul>
      <li parentName="ul">{`Explore the latest executed functions and analyze the results or errors. `}</li>
      <li parentName="ul">{`Manage registered functions and get execution summary. `}</li>
      <li parentName="ul">{`Code, build and execute functions.`}</li>
    </ul>
    <p>{`RedisGears is a dynamic framework that enables developers to write and execute `}<a parentName="p" {...{
        "href": "https://oss.redislabs.com/redisgears/functions.html"
      }}>{`functions`}</a>{` that implement data flows in Redis, while abstracting away the data’s distribution and deployment. These capabilities enable efficient data processing using multiple models in Redis with infinite programmability, while remaining simple to use in any environment.`}</p>
    <p>{`Follow the below steps to get started with the RedisInsight browser tool for RedisGears.`}</p>
    <h2 {...{
      "id": "step-1-create-redis-database"
    }}>{`Step 1. Create Redis database`}</h2>
    <p><a parentName="p" {...{
        "href": "/explore/redismod"
      }}>{`Follow this link to run Redis container with RedisGears modules enabled `}</a></p>
    <h2 {...{
      "id": "step-2-download-redisinsight"
    }}>{`Step 2: Download RedisInsight`}</h2>
    <p>{`To install RedisInsight on your local system, you need to first download the software from Redis Labs website.`}</p>
    <p><a parentName="p" {...{
        "href": "https://redislabs.com/redis-enterprise/redis-insight/#insight-form"
      }}>{`Click this link `}</a>{` to access a form that allows you to select the operating system of your choice.`}</p>
    <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/redisinsightinstall.png").default} /></p>
    <p>{`Run the installer. After the web server starts, open http://YOUR_HOST_IP:8001 and add a Redis database connection.`}</p>
    <p>{`Select "Connect to a Redis database"
`}<img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/redisinsight4.png").default} /></p>
    <p>{`Enter the requested details, including Name, Host (endpoint), Port, and Password.  Then click “ADD REDIS DATABASE”.`}</p>
    <h2 {...{
      "id": "step-3--clone-the-repository"
    }}>{`Step 3.  Clone the repository`}</h2>
    <pre><code parentName="pre" {...{}}>{`$ git clone https://github.com/RedisGears/ImdbExample
$ cd ImdbExample
`}</code></pre>
    <h2 {...{
      "id": "step-4-download-the-imdb-data"
    }}>{`Step 4. Download the IMDB data`}</h2>
    <p>{`Download the data from this link and extract it to the current directory: `}<a parentName="p" {...{
        "href": "https://datasets.imdbws.com/title.basics.tsv.gz"
      }}>{`https://datasets.imdbws.com/title.basics.tsv.gz`}</a></p>
    <pre><code parentName="pre" {...{}}>{`$ wget https://datasets.imdbws.com/title.basics.tsv.gz
$ gunzip title.basics.tsv.gz
`}</code></pre>
    <h2 {...{
      "id": "step-5-execute-the-script"
    }}>{`Step 5. Execute the script`}</h2>
    <pre><code parentName="pre" {...{}}>{`$ python3 UploadImdb.py -H localhost -P 6379

python3 UploadImdb.py -H 192.168.1.9 -P 6379
/Users/ajeetraina/projects/redis-datasets/redisgears/ImdbExample/UploadImdb.py:27: DeprecationWarning: Pipeline.hmset() is deprecated. Use Pipeline.hset() instead.
  pipe.hmset(d['tconst'], d)
done
`}</code></pre>
    <h2 {...{
      "id": "step-6-accessing-redisinsight"
    }}>{`Step 6. Accessing RedisInsight`}</h2>
    <p>{`Choose “RedisGears” on the left menu.`}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image1.png").default} title="image_tooltip" /></p>
    <h2 {...{
      "id": "step-7-add-the-below-script"
    }}>{`Step 7. Add the below script:`}</h2>
    <pre><code parentName="pre" {...{}}>{`GB('KeysOnlyReader').map(lambda x: execute('hget', x, 'genres')).flatmap(lambda x: x.split(',')).countby().run()
`}</code></pre>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image2.png").default} title="image_tooltip" /></p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image3.png").default} title="image_tooltip" /></p>
    <h2 {...{
      "id": "additional-references"
    }}>{`Additional References`}</h2>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://oss.redislabs.com/redisgears/"
        }}>{`RedisGears Project`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/howtos/redisgears"
        }}>{`RedisGears Tutorials`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/howtos/frauddetection"
        }}>{`How to build a Fraud Detection System using RedisGears and RedisBloom`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/howtos/nlp"
        }}>{`Building a Pipeline for Natural Language Processing using RedisGears`}</a></li>
    </ul>
    </MDXLayout>;
}

;
